import React from 'react';

const Templates = () => {
  return (
    <div>
      <h3 className="text-lg font-medium text-gray-900">Templates Library</h3>
      <p className="text-sm text-gray-500 mt-1">Pre-built, editable templates for common legal agreements.</p>
    </div>
  );
};

export default Templates;
